import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { motion } from 'framer-motion';

const Results = () => {
  const [results, setResults] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchResults();
    // eslint-disable-next-line
  }, []);

  const fetchResults = async () => {
    setLoading(true);
    try {
      const res = await axios.get('/api/results');
      setResults(res.data);
    } catch {
      setResults([]);
    }
    setLoading(false);
  };

  const getScorePercentage = (score, totalQuestions) => {
    if (!totalQuestions) return 0;
    return Math.round((score / totalQuestions) * 100);
  };

  const getScoreColor = (percentage) => {
    if (percentage >= 80) return '#28a745'; // zielony
    if (percentage >= 60) return '#ffc107'; // żółty
    return '#dc3545'; // czerwony
  };

  return (
    <motion.div className="container fade-in" initial={{ opacity: 0 }} animate={{ opacity: 1 }}>
      <h2 style={{ margin: '32px 0 24px 0', textAlign: 'center' }}>Twoje wyniki</h2>
      {loading ? (
        <div>Ładowanie wyników...</div>
      ) : results.length === 0 ? (
        <div className="card" style={{ textAlign: 'center', padding: '40px' }}>
          <h3>Nie masz jeszcze żadnych wyników</h3>
          <p>Rozpocznij rozwiązywanie quizów, aby zobaczyć swoje wyniki!</p>
        </div>
      ) : (
        <div style={{ display: 'flex', flexWrap: 'wrap', gap: 24, justifyContent: 'center' }}>
          {results.map(result => {
            const percentage = getScorePercentage(result.score, result.totalQuestions || 10);
            const scoreColor = getScoreColor(percentage);
            
            return (
              <motion.div
                className="card fade-in"
                key={result.id}
                whileHover={{ scale: 1.04 }}
                style={{ minWidth: 300, maxWidth: 400 }}
              >
                <h3 style={{ marginBottom: 12, color: '#667eea' }}>{result.quizTitle}</h3>
                <div style={{ marginBottom: 8 }}>
                  <b>Kategoria:</b> {result.quizCategory}
                </div>
                <div style={{ marginBottom: 8 }}>
                  <b>Poziom:</b> {result.quizDifficulty}
                </div>
                <div style={{ marginBottom: 8 }}>
                  <b>Wynik:</b> {result.score} / {result.totalQuestions || '?'}
                </div>
                <div style={{ marginBottom: 8 }}>
                  <b>Procent:</b> 
                  <span style={{ color: scoreColor, fontWeight: 'bold', marginLeft: 8 }}>
                    {percentage}%
                  </span>
                </div>
                <div style={{ marginBottom: 8 }}>
                  <b>Czas:</b> {result.timeSpent} sekund
                </div>
                <div style={{ marginBottom: 8 }}>
                  <b>Data:</b> {new Date(result.completedAt).toLocaleDateString('pl-PL')}
                </div>
                <div style={{ marginBottom: 8 }}>
                  <b>Godzina:</b> {new Date(result.completedAt).toLocaleTimeString('pl-PL')}
                </div>
              </motion.div>
            );
          })}
        </div>
      )}
    </motion.div>
  );
};

export default Results;
